script: |
  super -f text -I q7729.spq | sort > q7729.out

inputs:
  - name: q7729.spq
    data: |
      SELECT DISTINCT + + col2 * col1 AS col1 FROM tab1 (FORMAT parquet) WHERE + + col1 NOT BETWEEN - + col1 * + col2 * + - 83 + col2 AND + - 29;
  - name: tab1

outputs:
  - name: q7729.out
    data: |
      1344
      295
      3196
